def calculate_max_median_salary(n, s, salary_ranges):

    def can(mid, s):
        p = s
        low = high = 0
        k = []
        for (l_i, r_i) in salary_ranges:
            if r_i < mid:
                p -= l_i
                low += 1
            elif l_i > mid:
                high += 1
                p -= l_i
            else:
                p -= mid
                k.append((l_i, r_i))
        if low > (n - 1) // 2:
            return False
        if p >= 0:
            return True
        for i in range(low, (n - 1) // 2):
            if i - low >= len(k):
                break
            p += mid - k[i - low][0]
        return p >= 0
    salary_ranges.sort()
    l = 1
    r = 10 ** 10
    ans = salary_ranges[n // 2][0]
    while l <= r:
        mid = l + (r - l) // 2
        if can(mid, s):
            ans = mid
            l = mid + 1
        else:
            r = mid - 1
    return ans

